  const minDateVal = typeof minDate === 'number' ? new Date(minDate) : minDate;
  const maxDateVal = typeof maxDate === 'number' ? new Date(maxDate) : maxDate;
  return <DateTimePicker label={label} disabledHours={() => [0, 1, 2, 3, 4, 5, 6, 19, 20, 21, 22, 23]} minDate={minDateVal} maxDate={maxDateVal} date={date} showSeconds={showSeconds} onChange={newValue => {
    action('on change')(newValue);
    setDate(newValue);
  }} />;
